import React from 'react'
import github from '../images/ic-navbar-github.svg'
 function Margin() {
  return (
    <React.Fragment>
    <div className="left">
      <img src={{github}} alt="github" />
      <img src={{linkedin}} alt="linkedin" />
    </div>
    <div className="right"><span>Contacts</span></div>
    <div className="top"><h1>Myrian Katto</h1></div>
    </React.Fragment>
  )
}


export default Margin;
